		"BasicLineChart.js": "import React, { Component } from 'react';\nimport { Cartesian, Panel } from '@extjs/reactor/modern';\nimport data from './data';\nimport ChartToolbar from '../Charts/ChartToolbar';\n\nExt.require([\n    'Ext.chart.series.Line',\n    'Ext.chart.axis.Numeric',\n    'Ext.chart.axis.Time'\n]);\n\nexport default class BasicScatterChartExample extends Component {\n    \n    store = Ext.create('Ext.data.Store', {\n        data\n    });\n\n    state = {\n        theme: 'default'\n    };\n\n    changeTheme = (select, choice) => {\n        this.setState({ theme: choice.get('value') })\n    }\n\n    render() {\n        const { theme } = this.state;\n\n        return (\n            <Panel shadow layout=\"fit\">\n                <ChartToolbar\n                    onThemeChange={this.changeTheme}\n                    theme={theme}\n                />\n                <Cartesian\n                    insetPadding=\"40 40 60 40\"\n                    store={this.store}\n                    theme={theme}\n                    series={{\n                        type: 'line',\n                        xField: 'time',\n                        yField: 'value'\n                    }}\n                    axes={[{\n                        type: 'numeric',\n                        position: 'left',\n                        fields: 'value',\n                        title: 'USD to Euro'\n                    }, {\n                        type: 'time',\n                        dateFormat: 'Y-m-d',\n                        position: 'bottom',\n                        fields: 'time',\n                        title: 'Date'\n                    }]}\n                />\n            </Panel>\n        )\n    }\n}",
