	"BasicScatter": {
		"BasicScatter.js": "import React, { Component } from 'react';\nimport { Cartesian, Panel } from '@extjs/reactor/modern';\nimport createData from './createData';\nimport ChartToolbar from '../Charts/ChartToolbar';\n\nExt.require([\n    'Ext.chart.*',\n    'Ext.chart.series.Scatter',\n    'Ext.chart.axis.Numeric',\n    'Ext.chart.axis.Category'\n]);\n\nexport default class BasicScatterChartExample extends Component {\n    \n    constructor() {\n        super();\n        this.refresh();\n    }\n\n    store = Ext.create('Ext.data.Store', {\n        fields: ['id', 'g0', 'g1', 'g2', 'g3', 'g4', 'g5', 'g6', 'name']\n    });\n\n    state = {\n        theme: 'default'\n    };\n\n    refresh = () => {\n        this.store.loadData(createData(25));\n    }\n\n    toggleZoomOnPan = (zoomOnPan) => {\n        this.refs.chart.getInteraction('panzoom').setZoomOnPan(zoomOnPan);\n    }\n\n    changeTheme = (select, choice) => {\n        this.setState({ theme: choice.get('value') })\n    }\n\n    render() {\n        const { theme } = this.state;\n\n        return (\n            <Panel shadow layout=\"fit\">\n                <ChartToolbar\n                    onRefreshClick={this.refresh}\n                    onToggleZoomOnPan={this.toggleZoomOnPan}\n                    onThemeChange={this.changeTheme}\n                    theme={theme}\n                />\n                <Cartesian\n                    ref=\"chart\"\n                    insetPadding=\"20 20 10 10\"\n                    store={this.store}\n                    theme={theme}\n                    legend={{\n                        position: 'bottom'\n                    }}\n                    interactions={[\n                        'panzoom',\n                        'itemhighlight'\n                    ]}\n                    series={[{\n                        type: 'scatter',\n                        xField: 'id',\n                        yField: 'g1',\n                        title: 'Group 1',\n                        highlightCfg: {\n                            strokeStyle: 'red',\n                            lineWidth: 5\n                        },\n                        marker: {\n                            type: 'path',\n                            path: [\n                                ['M', 0, 1],\n                                ['L', 1, 0],\n                                ['L', 0, -1],\n                                ['L', -1, 0],\n                                ['Z']\n                            ],\n                            scale: 10,\n                            lineWidth: 2\n                        }\n                    }, {\n                        type: 'scatter',\n                        xField: 'id',\n                        yField: 'g2',\n                        title: 'Group 2',\n                        highlightCfg: {\n                            strokeStyle: 'red',\n                            lineWidth: 5\n                        },\n                        marker: {\n                            type: 'circle',\n                            radius: 10,\n                            lineWidth: 2\n                        }\n                    }]}\n                    axes={[{\n                        type: 'numeric',\n                        position: 'left',\n                        fields: ['g1', 'g2', 'g3', 'g4'],\n                        visibleRange: [0, 1],\n                        style: {\n                            estStepSize: 20\n                        },\n                        label: {\n                            rotate: {\n                                degrees: -30\n                            }\n                        }\n                    }, {\n                        type: 'category',\n                        position: 'bottom',\n                        visibleRange: [0, 0.5],\n                        fields: 'id'\n                    }]}\n                />\n            </Panel>\n        )\n    }\n}",
		"createData.js": "let seed = 1.3;\n\n// Controllable random.\nfunction random() {\n    seed *= 7.3;\n    seed -= Math.floor(seed);\n    return seed;\n}\n\nexport default function createData(numRecords) {\n    let data = [],\n        record = {\n            id: 0,\n            g0: 300,\n            g1: 700 * random() + 100,\n            g2: 700 * random() + 100,\n            g3: 700 * random() + 100,\n            g4: 700 * random() + 100,\n            g5: 700 * random() + 100,\n            g6: 700 * random() + 100,\n            name: 'Item-0'\n        }, \n        i;\n\n    data.push(record);\n\n    for (i = 1; i < numRecords; i++) {\n        record = {\n            id: i,\n            g0: record.g0 + 30 * random(),\n            g1: Math.abs(record.g1 + 300 * random() - 140),\n            g2: Math.abs(record.g2 + 300 * random() - 140),\n            g3: Math.abs(record.g3 + 300 * random() - 140),\n            g4: Math.abs(record.g4 + 300 * random() - 140),\n            g5: Math.abs(record.g5 + 300 * random() - 140),\n            g6: Math.abs(record.g6 + 300 * random() - 140),\n            name: 'Item-' + i\n        };\n        data.push(record);\n    }\n\n    return data;\n}\n"
	},
